import React from 'react'
import {Row, Col} from 'react-bootstrap'


function Homescreen() {
  return (
    <div> 
        <Row>
            {products.map(product => (
                <Col sm={12} md={6} lg={4} xl={3}>{product.name}</Col>
            ))}
        </Row>

    </div>
  )
}

export default Homescreen
